<#
.SYNOPSIS
  Creates company portal app using new store integration
.DESCRIPTION
Creates company portal app using new store integration.  Includes Icon and assigns to All Users
.INPUTS
None
.OUTPUTS
None
.NOTES
  Version:        1.0.0
  Author:         Andrew Taylor
  Twitter:        @AndrewTaylor_2
  WWW:            andrewstaylor.com
  Creation Date:  02/12/2022
  Purpose/Change: Initial script development
 
.EXAMPLE
N/A
#>

##Install Module
Write-Host "Installing Microsoft Graph modules if required (current user scope)"

#Install MS Graph if not available
if (Get-Module -ListAvailable -Name Microsoft.Graph.Devices.CorporateManagement) {
    Write-Host "Microsoft Graph Authentication Already Installed"
} 
else {
        Install-Module -Name Microsoft.Graph.Devices.CorporateManagement -Scope CurrentUser -Repository PSGallery -Force 
        Write-Host "Microsoft Graph Authentication Installed"
}

write-host "Importing Module"
##Import Module
Import-Module Microsoft.Graph.Devices.CorporateManagement

Write-Host "Module Imported"

##Connect to Graph
Select-MgProfile -Name Beta
Connect-MgGraph -Scopes Domain.Read.All, Directory.Read.All, DeviceManagementApps.ReadWrite.All, DeviceManagementManagedDevices.ReadWrite.All, openid, profile, email, offline_access



Function Get-ScriptVersion(){
    
    <#
    .SYNOPSIS
    This function is used to check if the running script is the latest version
    .DESCRIPTION
    This function checks GitHub and compares the 'live' version with the one running
    .EXAMPLE
    Get-ScriptVersion
    Returns a warning and URL if outdated
    .NOTES
    NAME: Get-ScriptVersion
    #>
    
    [cmdletbinding()]
    
    param
    (
        $liveuri
    )
$contentheaderraw = (Invoke-WebRequest -Uri $liveuri -Method Get)
$contentheader = $contentheaderraw.Content.Split([Environment]::NewLine)
$liveversion = (($contentheader | Select-String 'Version:') -replace '[^0-9.]','') | Select-Object -First 1
$currentversion = ((Get-Content -Path $PSCommandPath | Select-String -Pattern "Version: *") -replace '[^0-9.]','') | Select-Object -First 1
if ($liveversion -ne $currentversion) {
write-host "Script has been updated, please download the latest version from $liveuri" -ForegroundColor Red
}
}
Get-ScriptVersion -liveuri "https://raw.githubusercontent.com/andrew-s-taylor/public/main/Powershell%20Scripts/Intune/add-company-portal-newstore.ps1"


$uri = "https://graph.microsoft.com/beta/deviceAppManagement/mobileApps/"

write-host "Adding Company Portal to Intune"
##  Add the application
$json = @'
    {
    "@odata.type": "#microsoft.graph.winGetApp",
    "categories": [],
    "description": "Microsoft Intune helps organizations manage access to corporate apps, data, and resources. Company Portal is the app that lets you, as an employee of your company, securely access those resources.\r\n\r\nBefore you can use this app, make sure your IT admin has set up your work account. Your company must also have a subscription to Microsoft Intune.\r\n\r\nCompany Portal helps simplify the tasks you need to do for work:\r\n\r\n- Enroll your device to access corporate resources, including Office, email, and OneDrive for Business\r\n- Sign in to corporate resources with company-issued certificates\r\n- Reduce the number of times you need to sign in to corporate resources with single sign-on\r\n- Browse and install approved business apps from your IT department or the Microsoft Store for Business\r\n- View and manage your enrolled devices – and wipe them if they get lost or stolen\r\n- Get help directly from your IT department through available contact information\r\n \r\nA note about Intune: every organization has different access requirements, and will use Intune in ways that they determine will best manage their information. Some functionality might be unavailable in certain countries. If you have questions about how this app is being used within your organization, your company’s IT administrator should have those answers for you. Microsoft, your network provider, and your device’s manufacturer do not know how Intune will be used by your organization.",
    "developer": "",
    "displayName": "Company Portal",
    "informationUrl": "",
    "isFeatured": false,
    "roleScopeTagIds": [],
    "largeIcon": {
        "type": "image/png",
                "value": ""
    },
    "notes": "",
    "owner": "",
    "privacyInformationUrl": "http://go.microsoft.com/fwlink/?LinkID=316999",
    "publisher": "Microsoft Corporation",
    "packageIdentifier": "9WZDNCRFJ3PZ",
    "repositoryType": "microsoftStore",
    "manifestHash": "wingetv1:EiVo3jBjKACw3jmkKgszOpFjukAU5qL4m66hL2Vt7qQ=",
    "installExperience": {
        "runAsAccount": "user"
    }
}
'@

$companyportal = Invoke-MgGraphRequest -Uri $uri -Body $json -Method POST -ContentType "application/json"

write-host "Company Portal App ID: " $companyportal.Id " Added to Intune"

####Assign it
write-host "Assigning Company Portal to All Users"

$mobileAppId = $companyportal.Id
$uri2 = "https://graph.microsoft.com/beta/deviceAppManagement/mobileApps/$mobileAppId/assign"
$assignjson = @'
{
    "mobileAppAssignments": [
        {
            "@odata.type": "#microsoft.graph.mobileAppAssignment",
            "target": {
                "@odata.type": "#microsoft.graph.allLicensedUsersAssignmentTarget"
            },
            "intent": "Required",
            "settings": {
                "@odata.type": "#microsoft.graph.winGetAppAssignmentSettings",
                "notifications": "showAll",
                "installTimeSettings": null,
                "restartSettings": null
            }
        }
    ]
}
'@

Invoke-MgGraphRequest -Uri $uri2 -Body $assignjson -Method POST -ContentType "application/json"

write-host "Company Portal Assigned to All Users"